import React from 'react'
import axios from 'axios';
import {useNavigate} from "react-router-dom"
import { useState, useEffect } from 'react'

const Home = () => {

    const [itemData, setItemData] = useState({
        title: ''
    })

    const { title } = itemData

    const onChange = (e) => {
        setItemData((prevState) => ({
            ...prevState,
            [e.target.title]: e.target.value,
        }))
    }

  return (
    <section className="main">
        <div className="container grid">
            <div className="main-text">
                <h1>Efficient Approach</h1>
                <p>Work out camera provide you a chance to figure out your weak points objectively.  Upload a video of your movement, let's get started! </p>
            </div>

            <div className="main-form card">
                <h2>Quick Start</h2>
                <form>
                    <div className="form-control">
                    <p>Upload your video here</p>
                        {/* <input id="fileupload_1" type="file" name="fileupload_1" accept=".mp4"  required /> */}
                    </div>
                    <div className="form-control">
                        {/* <input id="fileupload_2" type="file" name="fileupload_2" accept=".mp4" required /> */}
                    </div>
                    <div className="form-control">
                        <input type="text" id="title" name="tilte" placeholder="Type title here" value={title} onChange={onChange} required/>
                    </div>
                    <input type="submit" value="Upload" className="btn btn-primary"/>
                </form>
            </div>
        </div>
    </section>
  )
}

export default Home
